import React, { Component } from 'react';
import { 
  WriterWrapper,
  WriterTitle,
  WriterSwitch,
  WriterItem,
  WriterName,
  Follow
} from '../style';

class Writer extends Component {
  render() { 
    return (
      <WriterWrapper>
        <WriterTitle>
          推荐作者
          <WriterSwitch>
            换一批
          </WriterSwitch>
        </WriterTitle>
        <WriterItem>
          <img className="writer-img" alt="" src="" />
          <WriterName></WriterName>
          <p className="writer-count"></p>
          <Follow> +关注</Follow>
        </WriterItem>

      </WriterWrapper>
    );
  }
}

export default Writer;
